import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

const Navbar = () => {
  return (
    <nav>
      {/* Department Logo */}
      <Link to="/">
        <img
          src="/images/logo.png" // Update this path to your logo's location
          alt="Department Logo"
          style={{ width: '50px', height: '50px', marginRight: '10px' }} // Adjust the size as per your needs
        />
      </Link>
      <div className="titel vollkorn-sc-semibold">Department of Computer Engineering</div> {/* Use font class here */}
      <div className="nav-links">
        <Link to="/" className="vollkorn-sc-regular">Home</Link> {/* Use font class here */}
        <Link to="/login" className="vollkorn-sc-regular">Login</Link> {/* Use font class here */}
        <Link to="/learning-center" className="vollkorn-sc-regular">Learning Center</Link> {/* Use font class here */}
      </div>
    </nav>
  );
};

export default Navbar;
